package com.letchic.model;import javax.persistence.*;@Entity@Table(name = "travelclass")public class TravelClass {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private long travelclassid;    private String travelclass;    private int emptyseats;    private double price;    public long getTravelclassid() {        return travelclassid;    }    public void setTravelclassid(long travelclassid) {        this.travelclassid = travelclassid;    }    public String getTravelclass() {        return travelclass;    }    public void setTravelclass(String travelclass) {        this.travelclass = travelclass;    }    public int getEmptyseats() {        return emptyseats;    }    public void setEmptyseats(int emptyseats) {        this.emptyseats = emptyseats;    }    public double getPrice() {        return price;    }    public void setPrice(double price) {        this.price = price;    }}